import React, { Component } from 'react';

class Suggested extends Component {
    render() { 
        return ( 
            <div>
                <div className="suggested"><h1>Sugestões para você</h1>
                    <button>Ver tudo</button>
                </div>
                <ul>
                    <Profiles />
                    <Profiles />
                    <Profiles />
                    <Profiles />
                    <Profiles />
                </ul>
            </div>
        );
    }
}

class Profiles extends Component {
    render() { 
        return ( 
            <li className="suggested-profiles">
                <img src="" alt="" />
                <a href="">Perfil</a>
                <p>Nome</p>
                <button>Seguir</button>
            </li>
        );
    }
}

export default Suggested;
